import postmates from './images/postmates.jpg'
import doordash from './images/doordash.jpg'
import grubhub from './images/grubhub.png'
import ubereats from './images/ubereats.png'

const appsData = [
    {
        id: 1,
        name: "Postmates",
        logo: postmates
    },
    {
        id: 1,
        name: "UberEats",
        logo: ubereats
    },
    {
        id: 1,
        name: "DoorDash",
        logo: doordash
    },
    {
        id: 1,
        name: "GrubHub",
        logo: grubhub
    }
]

export default appsData
